(1004, 'Nina', 'nina@tgeif.org', '2028690988', 'AN INVITATION TO TRADE MISSION TO ESTONIA / ENTRIES TO THE GO GLOBAL AWARDS 2022\r\n\r\nIt is my pleasure to invite your organization to participate in the Go Global Awards and accompanying trade mission and business round-tables this year.\r\n\r\nThe Go Global Awards is an annual gathering for exporters and related service providers, the International Trade Council\'s Go Global Awards offers a dedicated platform to exchange knowledge, new market information and develop strategies as well as establish lucrative new partnerships to drive business forward. The event is dedicated to all those organizations who, despite challenging times, display innovation and resilience.\r\n\r\nThis year, the Estonian Business and Innovation Agency will be hosting the awards program in Tallinn, Estonia, which includes:\r\n\r\n- Live-pitching for short-listed entrants before an panel of international government agency judges\r\n- Pre-organized B2B meetings and site-visits with c-level executives and government officials\r\n- An international trade conference (as a follow-on from some of the discussions held at the Global Economic Impact Forum on Ukraine in Istanbul [July 21-22]).\r\n- Awards gala-ceremony for winners\r\n\r\nThere are over 45 categories to choose from and organizations of all sizes and industries are encouraged to enter. \r\n\r\nTo enter the awards please go to https://www.goglobalawards.org\r\n\r\nShort-listed entrants and winners will be responsible for their own travel and accommodation to Tallinn, Estonia for final judging and presentations.\r\n\r\nTHERE IS NO CHARGE TO PARTICIPATE IN THE AWARDS ENTRY PROGRAM OF ANY SORT - THIS IS A \"FEE-FREE PROGRAM\".', 0, '2022-08-02 14:59:56', 1, 0),
