(1185, 'Kristal', 'kristal@goglobalawards.org', '2028690988', 'A quick reminder that the deadline for nominations for the Go Global AWards 2022 is the 31st August.\r\n\r\nThe Awards program this year will be held in Estonia, together with Estonian Business and Innovation Agency (formerly Enterprise Estonia). Dates for the final awards program, in-person judging of short-listed entrants, business mentoring etc - are the 19th to the 21st of October 2022.\r\n\r\nGovernment Officials from Bulgaria, Canada, Czech Republic, Estonia, Ireland, Lebanon, Moldova, and the USA have all confirmed to participate as judges and speakers to help guide companies in their overseas expansion efforts.\r\n\r\nYou can submit your nomination at https://goglobalawards.org/submit-your-entry/\r\n\r\nCompanies of all size are encouraged to enter.\r\n\r\nNOTE: The entire Go Global Awards system is FREE. Real awards don\'t cost money.  Buying fake awards and promoting yourself as “award winning” is deceptive and fraudulent to your clients, staff and partners.  The Go Global Awards and our sponsors would never ask you to pay fees of any kind to receive an award.  \r\n\r\nIf you have already submitted an entry please disregard this notice.\r\n\r\nKristal Parcon\r\nTrade Commissioner\r\nInternational Trade Council\r\nkristal@goglobalawards.org\r\nwww.goglobalawards.org', 0, '2022-08-22 22:22:30', 1, 0),
