(1191, 'Tigran Ayrapetyan', 'ujn2esbgakah@opayq.com', '85787435564', 'Hello, \r\n \r\nWith our business experience spanning over 2 decades and transiting from a real estate company into a dominant private investment company over the years. We will be glad to review, discuss and partner with you in your dream project as well as your existing businesses, by providing funding, ideas and strong networks if needed, in order to form a strategic business partnership. \r\n \r\nWe have a structured joint venture investment plan in which we are interested in an annual return on investment not more than 10% ROI. We are also currently structuring a convertible debt and loan financing of 3% interest repayable annually with no early repayment penalties. \r\n \r\nKindly submit your business plan, pitch deck or executive summary for us to review and to understand much better about your business and to further discuss a possible partnership. \r\n \r\nSincerely, \r\n \r\nTigran Ayrapetyan \r\nInvestment Director \r\nDevcorp International E.C. \r\nP.O Box 10236 Shop No. 305 \r\nFlr 3 Manama Centre, Bahrain \r\n \r\nEmail: tigran.ayrapetyan@devcorpinternationalec.com', 0, '2022-08-23 08:24:37', 1, 0),
