(1249, 'Kristal', 'kristal@goglobalawards.org', '2028690988', 'IMPORTANT REMINDER: Nominations for the Go Global Awards\r\n\r\nJust a reminder that the nominations for the Go Global Awards are closing soon. \r\n\r\nAwards Website: https://www.goglobalawards.org\r\n\r\nEntry Form: https://goglobalawards.formaloo.net/penvh\r\n\r\nFree Trade Mission to Europe: https://www.estoniatrademission.org\r\n\r\nLive Online Q&A Session / Webinar About the Awards - (31st August 2022)\r\nNB: Time will show in your own time-zone when looking at options below\r\nOption 1 - (9am EST | Midday PST - https://www.runtheworld.today/app/invitation/44322 )\r\nOption 2 - (9:30am UK | 11:30am Estonia | 2pm India | 4:30pm Singapore  - https://www.runtheworld.today/app/invitation/44406 )\r\n\r\nNote - the awards program is FREE OF CHARGE. **Real awards do not cost money to enter or win** \r\n\r\nShort-listed delegates will be invited to participate in live pitching events, b2b meetings with other delegates (investors, buyers, partners and government agencies) and a gala awards dinner. \r\n\r\nJudges come from Government Economic Development Agencies of: Albania, Andorra, Bulgaria, Bosnia, Canada, Czech Republic, Germany, Ireland, Latvia, Lithuania, Portugal, Moldova, North Macedonia, Romania, Slovenia, Sweden, Turkey, Ukraine and the USA.  Ms. Elizabeth Tanner, the Secretary of Commerce for the State of Rhode Island, will also be joining the international delegation along with several regional IPAs/EDOs from across the US. \r\n\r\nCONTACTS:\r\nEnterprise Estonia - James York - james.york@eas.ee\r\nEstonian Embassy in India - Vinod Basliyal - vinod.basliyal@eas.ee\r\nInternational Trade Council - Ron Nolasco - ron.nolasco@tradecouncil.org\r\n\r\n*Short-listed delegates are responsible for their own travel expenses and accommodation to/from Estonia. There are no fees for the program of events or entering or winning an award as these are government sponsored.', 0, '2022-08-30 06:17:18', 1, 0),
