(78, 11, '8.90604E+12', '123', 22, '100', 0, '0000-00-00 00:00:00', 4, 'ALOE VERA JUICE ', 'Aloe Vera Is Often Referred To As Mirculous Plant Because Of Its Numerous Health Benefits. Traditionally Aloe Vera Juice Is Kown To Have Alkaline Nature Which Helps Maintain Ph Balance. It Also Helps In Keeping Body Hyderated, Supports Digestion, Liver Function, Pancreas And Clear And Healthy Skin. Aloe Vera Juice Is Known To Enhance The Overall Immunity Of The Body, Making It A Must Have In Your Daily Diet. Sri Sri Tattva Aloe Vera Juice Is Made Using High Quality Ale Vera, Maintaining The Hygiene And Safety Standards. ', '20099000', 1, 250, 1200, 'Years', 4, 25, 1, '8906038785204.jpg', '8906038785204.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
