(80, 11, '8.90604E+12', '123', 22, '1000', 0, '0000-00-00 00:00:00', 4, 'AMLA JUICE ', 'Amla Or Indian Goseberry Is Considered As A Powerhouse Of Essential Nutrients And Minerals. According To Ancient Text, Amla Helps Balance All The Three Doshas In The Human Body. Amla Is An Excellent Source Of Vitamin C, Hence It Helps Boost Immunity, Metabolism, And Prevent Viral And Bacterial Ailments, Including Cold And Cough. It Is Traditionally Known To Promote Longevity, Enhance Digestion, Purify Blood, Benefit The Eye And Stimulate Hair Hrowth. One Of The Most Easy And Effective Way To Add Amla To Your Diet Is To Have Amla Juice. Sri Sri Tattva Amla Juice Is Made Using High Quality Amla Fruit, Maintaining The Highest Standard Of Hygiene And Safety.', '20099000', 2, 200, 1200, 'Years', 4, 25, 1, '8906038785198.jpg', '8906038785198.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(81, 11, '8.90604E+12', '123', 22, '1000', 0, '0000-00-00 00:00:00', 4, 'KARELA - JAMUN JUICE 1000ml', 'Karela Or Bitter Gourd Is A Unique Fruit Which Has Very Low Calories And Comes With Numerous Health Benefits. Rich In?Phyto-Nutrients?Like Minerals, Vitamins And Antioxidants, Bitter Gourd Also Contains?Polypetide-P. It Is Considered To Have?Hypoglycemic?Agent Called \"Charantin\" Which Helps Increase Glucose Absorption And Glycogen Synthesis In The Cells Of?Liver, Muscle And Adipose Tissue', '20099000', 1, 280, 1200, 'Years', 4, 25, 1, '8906038781619.jpg', '8906038781619.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
