(83, 11, '8.90604E+12', '123', 22, '100', 0, '0000-00-00 00:00:00', 2, 'MADHUKARI HERBAL TEA', 'Sri Sri?Tattva Madhukari Herbal Tea?Is An Exquisite Blend Of 16 Exotic Herbs. The Combination Of These Herbs Act As?Appetizer, Digestive Aid And Helps In?Kapha?Embalances. Use It As An Alternative To Your Daily Tea & Coffee And Get Refreshed And Energized With Aromatic Caffeine Free?Sri Sri?Tattva Madhukari Herbal Tea?', '30049011', 2, 75, 1200, 'Years', 4, 27, 1, '8906038781039.jpeg', '8906038781039.jpeg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
