(108, 11, '8.90604E+12', '123', 22, '500', 0, '0000-00-00 00:00:00', 2, 'ORGANIC JAGGERY', 'Organic Jaggery from Sri Sri Tattva is natural, pure and chemical free from every impurity. This jaggery is a rich source of an iron, alternative to refined sugar, used in any recipes.Helps in digestion and to cure anemia.', '17010000', 1, 99, 0, 'Years', 2, 10, 1, '8906038783910.jpg', '8906038783910.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(109, 11, '8.90604E+12', '123', 22, '500', 0, '0000-00-00 00:00:00', 2, 'ORGANIC QUINOA', 'Organic Quinoa from Sri Sri Tattva is one of the rich protien food with nutritious high fiber. This has high mineral content which reduces heart disease, also low Glycemic content which helps in maintaining the blood sugar level.', '10085000', 1, 250, 0, 'Years', 2, 10, 1, '8906038786690.png', '8906038786690.png', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(110, 11, '8.90604E+12', '123', 22, '1', 0, '0000-00-00 00:00:00', 1, 'ROCK SALT', 'Rock Salt Or Sendha Namak Is Extensively Used In Daily Meals. This Rock Salt Is A Healthy Addition To Your Kitchen Larder And Is The Perfect Ingredient To Help You Prepare Yummy Chats At Home. It Contains 84 Out Of The 92 Trace Elements Required By The Body Including Calcium, Iron, Zinc, Potassium, Magnesium, Copper And So On.', '25010020', 1, 70, 0, 'Years', 2, 11, 1, '8906038784108.jpg', '8906038784108.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(111, 11, '8.90604E+12', '123', 22, '1', 0, '0000-00-00 00:00:00', 1, 'SUPERIOR HEALTHY RED RICE', 'Red Rice Is A Variety Of Rice That Is Colored Red By Its Anthocyanin Content. It Is Usually Eaten Unhulled Or Partially Hulled, And Has A Red Husk, Rather Than The More Common Brown. Red Rice Has A Nutty Flavor. Compared To Polished Rice, It Has The Higher Nutritional Value Of Rices Eaten With The Germ Intact.', '10060000', 2, 130, 500, 'Years', 2, 11, 1, '8906038784085.jpg', '8906038784085.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(112, 11, '8.90604E+12', '123', 22, '1', 0, '0000-00-00 00:00:00', 1, 'SUPERIOR HEALTHY BLACK RICE', 'Sri Sri Tattva Black Rice Is One Of The Richest Source Of Disease-Fighting Antioxidants, And Also Contains High Amounts Of Dietary Fiber, Anti-Inflammatory Properties. Regular Consumption Of Sri Sri Tattva Black Rice Has The Ability To Help Stop The Development Of Diabetes, Cancer, Heart Disease And Even Weight Gain. It Is Rich In Iron And Anthocynanin Antioxidants.', '10060000', 2, 299, 500, 'Years', 2, 11, 1, '8906038783736.jpg', '8906038783736.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(113, 11, '8.90604E+12', '123', 22, '1', 0, '0000-00-00 00:00:00', 1, 'SUPER PREMIUM BASMATI RICE', 'Sri Sri Tattva?Basmati Rice Contains An Aromatic Flavour And Long Length Of Grains. Basmati Rice Being An Unforgettable And Rich Blend Of Royalty And Tradition Optimizes The Spirit Of An Exclusive And Incredible India.', '10060000', 2, 125, 500, 'Years', 2, 11, 1, '8906038784177.jpg', '8906038784177.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(114, 11, '8.90604E+12', '123', 22, '1', 0, '0000-00-00 00:00:00', 1, 'SONA MASURI GOLD', 'Sona masuri from Sri Sri Tattva is an aromatic rice that is lightweight. Most often used in dishes sweet Pongal, biryani,  idlis and fried rice.Sona masuri has a good dietary value.that is a fat free and superior resource of carbohydrates.', '10060000', 1, 75, 500, 'Years', 2, 11, 1, '8906038786577.jpg', '8906038786577.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(115, 11, '8.90604E+12', '123', 22, '1', 0, '0000-00-00 00:00:00', 1, 'SONA MASURI PREMIUM', 'Sona masuri from Sri Sri Tattva is an aromatic rice that is lightweight. Most often used in dishes sweet Pongal, biryani,  idlis and fried rice.Sona masuri has a good dietary value.that is a fat free and superior resource of carbohydrates.', '10060000', 1, 85, 500, 'Years', 2, 11, 1, '8906038786584.jpg', '8906038786584.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(116, 11, '8.90604E+12', '123', 22, '1', 0, '0000-00-00 00:00:00', 1, 'SUPERIOR HEALTHY BROWN RICE', 'Brown Rice from Sri Sri Tattva is a perfect healthy alternative staple for dietary fiber requirement. It is low in calories and packed with nutrients that are good for health. Brown rice helps in improving digestion and reducing cholesterol.', '10060000', 2, 140, 500, 'Years', 2, 11, 1, '8906038786607.jpg', '8906038786607.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
(117, 11, '8.90604E+12', '123', 22, '1', 0, '0000-00-00 00:00:00', 1, 'ATTA 1kg', 'Sri Sri Tattva Brings You Whole Wheat Atta (Flour). Each Kernel Of Wheat Used In This Atta Is Picked Carefully From Farms. It Is Then Cleaned, Processed And Packed In The Most Hygienic Conditions. Whole Wheat Atta Is Considered To Be A Natural Source Of 300 Types Of Enzymes, Magnesium And Minerals And Since Ages It Has Been An Integral Part Of Our Daily Food.', '11010000', 0, 46, 500, 'Years', 2, 9, 1, '8906038783262.jpg', '8906038783262.jpg', 1, 0, '', 0, '2019-10-31 18:25:35', 0),
